import React, {Fragment} from 'react';
import { Link, withRouter } from 'react-router-dom';

const Record = (props) => {
    if (!props.record) {
        // If there's no id from memory has to redirect
        props.history.push('/');
        return null;

    }
    return (
        <Fragment>
            <h1>Paciente: {props.record.name}</h1>
            <div className="container mt-5 py-5">
                <div className="row">
                    <div className="col-12 mb-5 d-flex justify-content-center">
                        <Link to={'/'} className="btn btn-success text-uppercase py-2 px-5 font-weight-bold">
                            Go back
                        </Link>
                        <div className="col-md-8 mx-auto">
                            <div className="list-group">
                                <div className="p-5 list-group-item list-group-item-action flex-column align-items-center">
                                <div className="d-flex w-100 justify-content-between mb-4">
                                        <h3 className="mb-3">{record.name}</h3>
                                        <small className="date-release">{record.date} - {record.hour}</small>
                                    </div>
                                    <p className="mb-0">{record.symthoms}</p>
                                    <div className="contact py-3">
                                        <p>Insurance: {record.insurance}</p>
                                        <p>Contact: {record.phone}</p>
                                    </div>
                                </div>
                            </div>

                        </div>
                    </div>
                </div>
            </div>
        </Fragment>

    );
}

export default withRouter(Record);
